#!/usr/bin/env python3
from Crypto.Cipher import AES
import base64, zlib, sys

# ---- INTERNAL KEY ----
KEY = b'E\xeaOK\x01\xd6\x89\x1a\x83\x1e\xf2\x00A\x9fK\x11z\xa2\x13b\xb0\xc1c\xa4Q^\xd3\x9a#\xb7\xe6F'

# ---- ENCRYPTED DATA ----
ENCRYPTED = ""

def decrypt():
    try:
        data = base64.b64decode(ENCRYPTED)
        nonce, tag, ciphertext = data[:16], data[16:32], data[32:]
        cipher = AES.new(KEY, AES.MODE_EAX, nonce)
        decompressed = zlib.decompress(cipher.decrypt_and_verify(ciphertext, tag))
        return decompressed.decode()
    except Exception as e:
        print("â›” Error: Failed to decrypt script!")
        sys.exit(1)

# Execute original code
exec(decrypt())
